    private fun String.getJsonArray(key: String): String {
        val wrap = "\"$key\":["
        val start = this.indexOf(wrap)
        if (start < 0) return "[]"

        var count = 0
        val from = start + wrap.length - 1
        var end = 0
        for (i in from until this.length) {
            if (this[i] == '[') count++
            if (this[i] == ']') count--
            if (count == 0) {
                end = i
                break
            }
        }
        return this.substring(from..end)
    }

    @Test
    fun extractCookie() {
        val map = cookie.split(";").associate {
